INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(2, 'Harley Benton TE-52 NA Vintage Series', 'This electric guitar features an American ash body with a bolt-on neck made of caramelized Canadian maple and a Roseacer stripe. The fretboard is also caramelized maple with dot inlays, a C-shaped neck profile, and a 350 mm radius. It has 21 medium jumbo frets, a 648 mm scale length, and a nut width of 42 mm. Equipped with two Roswell TEA Alnico-5 single-coil pickups (TE style), it includes one volume knob, one tone knob, and a 3-way selector switch. The guitar has chrome deluxe hardware, Kluson-style tuners, .010-.046 strings, and a high-gloss natural finish.', , 168.00, 5, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(3, 'Startone CG 851 4/4 Set 1 NT', 'This 4/4 classical guitar features a linden body and neck, maple fretboard with 19 frets, 650 mm scale, 52 mm nut width, and nylon strings. It has a satin light brown finish and includes a gig bag, tuner, and picks.', , 66.00, 9, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(4, 'Gibson ES-335 Dot Vintage Burst', 'This electric guitar features a maple body and top, a mahogany neck with a rounded C profile, and a rosewood fretboard with dot inlays. It has 22 frets, a 628 mm scale, and a 42.8 mm nut width. Equipped with two calibrated humbuckers, Vintage Deluxe Keystone tuners, and an ABR-1 bridge, it comes with nickel hardware and a Vintage Burst finish. Made in the USA, it includes a hard case.', , 2999.00, 2, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(5, 'Epiphone Casino Vintage Sunburst', 'This hollow-body electric guitar features a laminated maple body and top, a mahogany neck, and an Indian laurel fretboard with miniature trapezoid inlays. It has a dove-wing headstock, cream binding, a 628 mm scale, a 43 mm Graph Tech NuBone nut, and 22 frets. Equipped with two Epiphone Pro P90 pickups and a LockTone Tune-o-matic bridge, it comes in a Vintage Sunburst finish with a gig bag included.', , 608.00, 22, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(6, 'Cascha Premium Mahagoni Sopran', 'This soprano ukulele set is perfect for beginners and advanced players. It features a mahogany top, back, and sides, with a mahogany neck and a WPC fretboard and bridge. It has 16 frets, a 344 mm scale, a 35 mm nut width, chrome closed tuners, and Aquila Super Nylgut strings. Finished in open-pore satin, it comes in a natural color.', , 55.00, 12, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(7, 'Kala KA-HIBISCUS-S Mahogany Uke', 'This soprano ukulele from The Voyage Collection features a mahogany top with a \"Resourceful\" hibiscus design by Māori artist Sam Mangakahia, complemented by mahogany back, sides, and neck. It has a rosewood fretboard, 18 frets, a 343 mm scale, and Graph Tech NuBone nut and saddle. Equipped with open tuners with white buttons and Aquila Super Nylgut strings, it comes in a natural satin finish with a Voyage Collection gig bag included.', , 88.00, 14, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(8, 'Harley Benton JB-75MN Black Vintage Series', 'This Vintage Series electric bass features an American ash body and a bolt-on hard Canadian maple neck with a Roseacer stripe. The maple fretboard has black ABS block inlays, a black binding, and a D-profile neck with a 305 mm radius. It includes 20 medium nickel-silver frets, a 38 mm graphite nut, and an 864 mm scale length with a dual-action truss rod. Equipped with Roswell JBA Alnico 5 single-coil pickups (bridge and middle), it offers two volume controls, one tone control, and a single-ply black pickguard. The hardware includes a Sung Il WB401CR bridge with brass saddles, HB CB01-CR tuners, chrome fittings, and D\'Addario EXL165 strings (.045–.105). Finished in sleek black.', , 168.00, 13, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(9, 'Marcus Miller V7 Swamp Ash-4 Reissue TS', 'This electric bass features a swamp ash body with a figured poplar top and a bolt-on maple neck. The maple fretboard has rounded edges and white pearloid block inlays. It includes a bone nut, a C-profile neck, a 38 mm nut width, a 241 mm radius, and a 34\" (864 mm) scale length. With 20 Medium Jumbo frets, it has a three-ply ivory pearloid pickguard. Equipped with two Marcus Super-J Revolution single-coil pickups and a Marcus Heritage-3 preamp, controls include Volume/Tone, Blender, Treble, Middle/Freq, and Bass. Hardware features a Marcus Heavy Mass II bridge, chrome fittings, and premium open tuners. Finished in a Tobacco Sunburst.', , 699.00, 11, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(10, 'Harley Benton Bass Guitar Kit J-Style', 'This DIY electric bass kit requires some manual skills for successful assembly and painting. It features a Rengas body (wood color may vary), a bolt-on maple neck, and an amaranth fretboard with dot inlays. The bass includes 21 frets, a 38 mm nut width, an 864 mm scale length, and a dual-action truss rod. It is equipped with two single-coil pickups, two volume controls, and one tone control. Chrome hardware includes die-cast tuners, and it uses .045–.105 gauge strings. Finished in natural wood, ready for customization.', , 98.00, 0, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(11, 'Fender Flea Sig Bass RDWRN SHP', 'This 4-string electric bass is the Flea Signature model (Red Hot Chili Peppers), featuring an offset alder body and a maple neck with a C profile. The rosewood fretboard includes 20 vintage frets, and it has a long scale length. Equipped with two Pure Vintage \'64 J-Bass single-coil pickups, it also features a special headstock plate with Flea\'s artwork. Finished in nitrocellulose lacquer with a Faded Shell Pink color, it comes with a gig bag included.', , 1579.00, 9, 1);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(12, 'Yamaha B3 SC3 PE', 'This upright silent piano features the SC3 silent system, a solid spruce soundboard, and 12 instrument voices with Bluetooth MIDI/Audio functionality. With its larger size and complex construction, the b3 delivers a fuller, richer sound, ideal for advanced musicians. It combines excellent playability and tonal quality with great value. The elegant traditional design includes mobility-friendly casters. Dimensions are 152 cm wide, 121 cm high, and 62 cm deep, weighing 241 kg. Finished in polished black, it comes with a piano bench, lamp, and headphones.', , 8290.00, 24, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(13, 'Blüthner Model D white', 'This upright piano features Blüthner\'s advanced soundboard construction technology, offering unmatched dynamics for its size. It measures 116.5 cm in height, 154 cm in width, and 61.5 cm in depth. Finished in polished white, it comes with a matching bench and lamp. Made in Germany, it exemplifies superior craftsmanship and tonal excellence.', , 15790.00, 0, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(14, 'Yamaha GB1 K SC3 PE Grand Piano', 'This silent grand piano is equipped with Yamaha\'s SC3 silent system, featuring 12 instrument voices and Bluetooth MIDI/Audio functionality. It offers exceptional playability and meets Yamaha\'s high standards, ensuring a delightful playing experience. With 88 keys and three pedals (including a sostenuto pedal), it measures 151 cm in length, 146 cm in width, and 99 cm in height, weighing 265 kg. Finished in polished black, it includes a piano bench and headphones.', , 16690.00, 83, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(15, 'Thomann GP 160 E/P Grand Piano', 'This grand piano features a Renner grand piano mechanism and hammerheads, adjusted, tuned, and tested by master piano makers. It includes a soft-close mechanism for smooth lid operation. Measuring 160 cm in length, 151 cm in width, and 102 cm in height, it weighs 315 kg. Finished in polished black, it comes with a height-adjustable piano bench and a 5-year Thomann warranty.', , 6990.00, 8, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(16, 'Yamaha GB1 K PWH', 'The Yamaha GB1 grand piano offers the classic power, tone, and expressive range of a traditional Yamaha piano in a compact design, making it perfect for smaller spaces and budgets. It features 88 keys, three pedals, and delivers exceptional quality and performance at an accessible price. Measuring 149 x 146 x 99 cm and weighing 249 kg, it is finished in polished white, combining elegance with practicality.', , 12990.00, 34, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(17, 'Yamaha B3 PEC', 'This upright piano features 88 keys and a solid spruce soundboard for rich tonal quality. It includes three pedals and is equipped with wheels for easy mobility. Measuring 152 cm in width, 121 cm in height, and 61 cm in depth, it weighs 237 kg. The piano is finished in polished black with chrome fittings and comes with a matching bench and lamp.', , 5990.00, 98, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(18, 'Thomann SP-120', 'This digital piano features 73 velocity-sensitive semi-weighted keys, 12 instrument sounds, and 12 demo songs. With 32-voice polyphony, it offers Layer mode, reverb, chorus, a metronome, and adjustable tempo.\r\n\r\nConnectivity includes a headphone output, USB to Host (MIDI and audio for Windows 8+/Mac OSX 10.8+), stereo line outputs (L/R), and a sustain pedal input. The built-in speaker system delivers 2 x 20 watts, and it can operate on batteries for portability.\r\n\r\nMeasuring 1070 x 275 x 88 mm and weighing 6.2 kg, the piano is finished in black. It includes a power adapter, sustain pedal, and music stand. An optional protective case is available separately.', , 175.00, 45, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(19, 'AKAI Professional MPK Mini MK3', 'This MIDI keyboard/controller features 25 velocity-sensitive mini keys and a 4-direction joystick for pitch and modulation control. It includes 8 MPC pads with Note Repeat and Full Level functions, 8 assignable encoders, and an octave selector with a 10-octave range. An integrated arpeggiator and an OLED screen for parameter display enhance functionality.\r\n\r\nConnectivity includes a sustain pedal input (6.3 mm jack) and a USB-B port (Class Compliant). Compact and lightweight, it measures 318 x 181 x 44 mm and weighs 750 g. The package includes software downloads: MPC Beats, 6 virtual instruments (Bassline, Tubesynth, Electric, Hybrid 3, Mini Grand, Velvet), and 2 GB of sound content. Optional flight case and carrying bag sold separately.', , 85.00, 109, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(20, 'Arturia PolyBrute 12', 'This 12-voice polyphonic analog synthesizer features a 61-key velocity-sensitive FullTouch MPE keyboard. It includes two analog oscillators (sawtooth, triangle with Metalizer, square with pulse width, sub-oscillator, FM, and sync) and a noise generator with constant color. The dual-filter design offers a 12 dB Steiner-Parker multimode and a 24 dB Ladder low-pass filter with drive and FM options.\r\n\r\nModulation capabilities include 3 ADSR envelopes with looping, 3 LFOs (2 with advanced phase and sync options, 1 with variable waveforms), and a 12x32 modulation interface for 64 matrix-style patch points. The instrument includes 3 stereo digital effects slots (modulation, reverb, and delay), a 64-step polyphonic sequencer with motion recording and automation, and an OLED display.\r\n\r\nIt comes with 480 factory presets and 768 user slots, along with unique control features like an assignable ribbon controller, a 3-axis Morphée pad for morphing or randomizing, pitch bend and modulation wheels, and a multimode arpeggiator. Connectivity includes line outputs, MIDI In/Out/Thru, USB MIDI, sync I/O, and pedal inputs.\r\n\r\nMeasuring 972 x 157 x 380 mm and weighing 22.8 kg, it is compatible with the PolyBrute Companion software (PC/Mac). Optional wooden stand sold separately.', , 3699.00, 56, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(21, 'Clavia Nord Electro 6 HP', 'This stage piano/synthesizer features 73 keys with Nord Hammer Action Portable mechanics for an authentic feel. It offers Split and Layer functions across three sections, with six split points indicated by LEDs. The instrument includes 1 GB of Nord Piano Library, 512 MB of Nord Sample Library, and advanced polyphony.\r\n\r\nIt provides organ simulations such as the Nord C2D B3 tonewheel, a church organ model, and B3 Tone Wheel Bass, plus the Leslie 122 rotary speaker simulation. Additional features include a Set List function, seamless transitions, a Dual-Organ mode, and nine LED drawbars. All effects are stereo, including tube overdrive, Vibe, reverb, and delay.\r\n\r\nConnectivity includes stereo line outputs (L/R), a 3.5 mm stereo monitor input, headphone output, sustain and control pedal inputs, a rotary speaker control pedal input, MIDI In/Out, and a USB port (MIDI). Measuring 1074 x 344 x 121 mm and weighing 11.4 kg, it supports an optional Half Moon switch and flight case (sold separately).', , 2499.00, 16, 2);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(22, 'Millenium Focus Junior Drum Set Black', 'This complete drum kit from the Focus series is designed for children aged 4 to 7 years. It includes a 16\"x10\" bass drum, 8\"x5\" and 10\"x6\" toms, a 13\"x11\" tom stand, and a 12\"x5\" wooden snare drum, all finished in black rhodoid. The set also comes with a pair of drumsticks and a bass drum dampening pad.\r\n\r\nThe simple hardware set includes a cymbal stand, hi-hat pedal, snare drum stand, bass drum pedal, tom mounts, and a seat. The brass cymbal set includes 10\" hi-hats and a 12\" crash/ride cymbal.', , 179.00, 36, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(23, 'Millenium Focus Junior Drum Set Red', 'This complete drum kit from the Focus series is designed for children aged 4 to 7 years. It includes a 16\"x10\" bass drum, 8\"x5\" and 10\"x6\" toms, a 13\"x11\" tom stand, and a 12\"x5\" wooden snare drum, all finished in red rhodoid. The set also comes with a pair of drumsticks and a bass drum dampening pad.\r\n\r\nThe simple hardware set includes a cymbal stand, hi-hat pedal, snare drum stand, bass drum pedal, tom mounts, and a seat. The brass cymbal set includes 10\" hi-hats and a 12\" crash/ride cymbal.', , 179.00, 26, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(24, 'DrumCraft Series 3 Studio Set Natural', 'This drum kit from the Series 3 is designed in a studio configuration, featuring a 20\"x16\" bass drum, 10\"x7\" and 12\"x8\" toms, a 14\"x12\" floor tom, and a 14\"x5\" snare drum. The shells are made of 7-ply poplar with a 6.8 mm thickness and 45° bearing edges. The hardware is chrome-plated, and the kit is finished in Natural Grain Fade rhodoid.\r\n\r\nThe 4-piece hardware pack includes a bass drum pedal, hi-hat pedal, snare drum stand, and cymbal boom stand.', , 525.00, 22, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(25, 'Millenium MPS-850 E-Drum Set', 'This complete electronic drum kit features a sound module with 550 sounds, 30 preset kits, 20 user kits, 100 songs, and 2 user songs. It includes functions like quick recording, metronome, EQ per kit, pitch adjustment, reverb, and compressor. Six faders allow you to adjust the individual volume of the pads, metronome, and songs. Connectivity options include 2 main outputs (6.3mm Jack), a headphone output (stereo 6.3mm Jack), a line input (3.5mm stereo mini Jack), and 2 trigger inputs (6.3mm Jack). It also supports USB MIDI, USB memory, and MIDI In/Out, as well as importing WAV samples. The kit includes 1x 10\" snare pad with dual-zone mesh head, 2x 8\" tom pads with dual-zone mesh heads, 2x 10\" tom pads with dual-zone mesh heads, 1x 8\" bass pad with mesh head, 2x 12\" crash pads with dual-zone (chokeable), 1x 12\" ride pad with three zones (chokeable), and 1x 12\" hi-hat pad. Hardware and accessories include a rack, hi-hat pedal, bass drum pedal, power supply, cabling, a pair of drumsticks, and the required space of approximately 140 x 80 cm', , 598.00, 98, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(26, 'Alesis Crimson II SE Mesh Kit', 'This electronic drum kit includes the Crimson II sound module with 671 sounds, 54 presets, and 20 user kits. It features Dynamic Articulation technology and real-time recording capabilities. The module offers mono L/R outputs (6.3mm Jack) for direct connection to a mixer or monitor, 2 Aux outputs (6.3mm Jack), a headphone output (3.5mm stereo mini Jack), and an input for MP3/CD player (3.5mm stereo mini Jack). It also supports MIDI In/Out, a USB port for MIDI connection and loading new songs via USB drive. The kit includes 1x 12\" snare pad with dual-zone mesh head, 2x 8\" tom pads with dual-zone mesh heads, 1x 10\" tom pad with dual-zone mesh head, 1x 8\" bass pad with mesh head, 1x 12\" hi-hat pad with dual-zone, 2x 12\" crash pads with dual-zone (chokeable), and 1x 14\" ride pad with three zones (chokeable). The kit also includes a rack and a snare stand, with a required space of approximately 130 x 100 cm.', , 848.00, 30, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(27, 'Roland SPD-SX PRO Sampling Pad', 'This sample pad includes 9 pads and offers over 1550 samples and sounds. It features 43 preset kits (erasable) and 157 user kits, with 32GB of internal storage for samples. It includes accompaniment tracks and click tracks, and supports the import of WAV/AIFF files (48/44.1 kHz, 16/24/32 bits) and MP3 files (32-320 kbps), with automatic conversion to 48 kHz/16 bits. The unit has a 4.3\" color screen and supports up to 4 parallel effects with side-chain routing. It includes a 16-step sequencer, metronome, and real-time WAV recording. The pad sensitivity is enhanced, and crosstalk performance has been improved. A dedicated SPD-SX PRO app for Windows/Mac is included for easy sample import, kit management, and in-depth editing.\r\n\r\nThe dimensions are 360 x 330 x 93 mm, with a weight of 3 kg, and it comes with a power supply.\r\n\r\nConnectivity options include 2 Master outputs (balanced, 6.3mm Jack), 4 Direct outputs (balanced, freely assignable, 6.3mm Jack), 1 headphone output (stereo 6.3mm Jack), 1 line input (stereo 6.3mm Jack with its own volume control), 4 Trigger inputs (stereo 6.3mm Jack for up to 8 individual external triggers or pads), 1 connection for hi-hat controller or expression pedal (6.3mm Jack), and 1 input for single or double footswitch (6.3mm Jack).', , 829.00, 2, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(28, 'Millenium MD-90 Mobile Drum', 'This digital percussion unit features 7 velocity-sensitive pads and offers 265 percussion/drum sounds. It comes with 45 fixed preset drum kits, 5 user presets, and 100 song presets stored. It includes 1 demo song. The unit has a headphone output and USB interface (1.0 + 2.0 for MIDI In/Out).\r\n\r\nThe dimensions are 500 x 370 x 157 mm, and it includes a pair of drumsticks, small foot pedals for hi-hat and bass drum, as well as a 12V 2000 mA power supply.', , 119.00, 3, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(29, 'Thomann Latin Expert Bongos', 'This bongo set features diameters of 7.15\" and 8.5\" with a barrel-type construction. The drums are made with 2-ply mahogany shells and come with chrome hardware. The rims are 2.5 mm rounded, and the tension rods are 8 mm. The heads are Remo Fiberskyn. The color is black and silver, and the bongos are handcrafted.', , 119.00, 98, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(30, 'Startone Handpan D Kurd A=432Hz', 'This handpan is tuned in the Kurd scale in D. It features 9 notes: D/A, B, C, D, E, F, G, A. The note A is tuned to 432 Hz. The instrument has a rubber ring and comes with a backpack, stand, and cloth for maintenance.', , 498.00, 26, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(31, 'DW Finish Ply Broken Glass SSC+', 'This drum shell set from the Collector Finish Ply series includes bass drum 22\" x 18\" (VLX+) tom 10\" x 8\" (VLT) tom 12\" x 9\" (VLT) floor tom 14\" x 12\" (X-Shell) and floor tom 16\" x 14\" (VLX) The shells are made from maple and feature chrome hardware It is equipped with the STM suspension system and True-Pitch 50 tuning rods for precision tuning The True Hoop rims and \"Timbre Matched\" process ensure that the drums are harmonically matched based on their dominant tone The finish is Rhodoïd with a Broken Glass color.', , 5998.00, 3, 3);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(46, 'the box DSX Power Bundle', 'This set includes two the box Pyrit 212 Sub A subwoofers (dual 12\", 1000 W RMS, 4000 W peak, 132 dB SPL, 31.5–120 Hz, stereo combo/XLR inputs, 36 mm pole mounts, 735 x 475 x 520 mm, 41 kg) and two the box pro DSX 112 speakers (12\" woofer, 1\" driver, 2000 W, 128 dB SPL, H90° x V60°, DSP, 395 x 640 x 390 mm, 19.14 kg).\r\n\r\nAlso included are two Roadworx Multi Poles (880–1360 mm adjustable, 35 mm/M20 base, 1.2 kg) and two pro snake TPM 2.5 cables (2.5 m XLR 3-pin male-female, Rean connectors) Optional covers available.', , 1979.00, 32, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(47, 'JBL PRX915/918 Power Bundle', 'This set includes 2 JBL PRX918XLF active subwoofers with 18-inch speakers 2000W peak power 134 dB SPL DSP with EQ feedback suppression and Bluetooth control dimensions 591x654x693 mm weight 40.7 kg black finish and 7-year warranty 2 JBL PRX915 active speakers with 15-inch woofers 2000W peak power 133 dB SPL DSP with 12-band EQ and Soundcraft Overeasy limiter Bluetooth control dimensions 465x383x717 mm weight 24.1 kg black finish and 7-year warranty 2 Millenium BS-2020S MK II adjustable speaker poles with M20 threading 35 mm diameter weight 2.1 kg black and 2 pro snake TPM 3.0 CC microphone cables 3 m XLR connectors silver and black finish with cable ties.', , 5298.00, 3, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(48, 'JBL PRX 415M', 'The passive multifunction speaker features a 15\" woofer and a 1\" tweeter, with a power handling capacity of 600 Watts program and 1200 Watts peak. It has an impedance of 8 Ohms and a frequency response range of 55 Hz to 19,000 Hz. The maximum sound pressure level is 128 dB, with a dispersion angle of 90° x 50°. It includes two connections via Speaker Twist and has dimensions of 650 mm in height, 429 mm in width, and 457 mm in depth. The speaker weighs 21 kg.', , 599.00, 0, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(49, 'Sennheiser E835 S', '\r\nThe dynamic microphone features a cardioid polar pattern with a frequency response range of 40 Hz to 16,000 Hz and an impedance of 350 Ohms. It includes an on/off switch and has dimensions of Ø 48 mm by 180 mm. The microphone weighs 330 g and comes with a clip and carrying pouch.', , 89.00, 102, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(50, 'the t.bone GM 55', '\r\nThe dynamic vocal microphone, model \"Elvis,\" features a supercardioid polar pattern with a frequency response range of 40 Hz to 17,000 Hz and a sensitivity of 2.4 mV/Pa. It can handle a maximum sound pressure level of 155 dB and has an impedance of 415 Ohms. The microphone includes an on/off switch, a head with a swivel mount, and a 5/8\" thread for mounting on a stand, with a 3/8\" adapter included. The metal housing ensures durability, and the microphone weighs 527 g. The included metal tripod weighs 395 g, and the entire set comes in a plastic carrying case.', , 69.00, 45, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(51, 'Sennheiser MD 435', 'The dynamic vocal microphone features a cardioid polar pattern with a frequency response range of 40 Hz to 20,000 Hz and a maximum sound pressure level of 163 dB. It has an impedance of 245 Ohms and a sensitivity at rest of -54.9 dBV/Pa (1.6 mV). The microphone is equipped with a capsule mounted on an elastic suspension to improve resistance to structural noise. Its dimensions are 181 mm in length and 47.5 mm in diameter, and it weighs 350 g.', , 459.00, 33, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(52, 'DPA 4560 Binaural Headset Micro', '\r\nThe clip-on condenser microphone is ideal for capturing authentic 3D sound, making it perfect for cinematic recordings. It features an omnidirectional polar pattern with a frequency response range of 20 Hz to 20,000 Hz, and includes a +3 dB presence boost from 8 to 20 kHz. The microphone can handle a maximum sound pressure level of 134 dB and has an output impedance of 30-40 Ohms. It uses a MicroDot connector and weighs just 7.5 grams with the cable and connector. The capsule diameter is 5.4 mm, and the microphone itself is 12.7 mm long. The cable length is 1.8 meters, and the microphone is black in color.', , 1059.00, 76, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(53, 'Hörluchs EasyUp', 'The universal single-driver in-ear headphones feature 8 mm dynamic drivers with enhanced bass amplification. The ergonomic housings ensure a comfortable fit, and the headphones offer a sensitivity of 119 dB SPL at 1 mW. With an impedance of 16 Ohms at 1 kHz, they provide a frequency response range of 20 Hz to 25,000 Hz. The detachable cable is 1.2 meters long, and the headphones come in black. Included are silicone ear tips in three different sizes and a carrying pouch. Please note that, in accordance with current European regulations on volume limitations, this product is designed exclusively for professional use and is not intended for the consumer market.', , 85.00, 10, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(54, 'the sssnake SM10BK', 'The microphone cable is 10 meters in length and features a 3-pin male XLR connector and a 3-pin female XLR connector. It has a wire gauge of 2x0.22 mm² and a diameter of 6 mm. The cable is black in color.', , 7.80, 303, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(55, 'the sssnake IPP1030', 'The instrument cable is 3 meters in length and features 6.3 mm jack connectors on both ends. The cable has a cross-sectional area of 0.22 mm² (AWG 24) and an outer diameter of 6 mm. The cable is black in color.', , 3.44, 279, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(56, 'K&M 210/9 Black', 'The microphone boom stand is identical to the K&M 210/2 model but features an extendable boom arm. It has a die-cast metal base with foldable legs and a wide tripod surface for stability. The height is adjustable from 900 mm to 1600 mm, and the boom arm extends from 460 mm to 770 mm. The stand weighs 3.2 kg and comes in black. It includes two cable clips for secure cable management.', , 55.00, 55, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(57, 'K&M 18826 Equipment Stand', 'The stand is ideal for holding mixers, monitors, keyboards, or amplifiers. It features a scissor structure with floor protection pads and a compensator to stabilize the stand on uneven surfaces. The front rubber pads are movable around an axis to adjust to the size of the device. The height is adjustable from 595 mm to 1015 mm, and the width of the pad is adjustable from 250 mm to 840 mm. The support depth is 350 mm. Made of steel, the stand can support a maximum weight of 50 kg. When folded, it measures 395 x 105 x 595 mm and weighs 5.6 kg. The stand comes in black.', , 109.00, 98, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(58, 'Behringer Xenyx QX2222USB', 'The mixing console features 22 channels with 60 mm faders, including 8 microphone inputs with +48V phantom power and a 75 Hz low-cut filter. Each microphone channel is equipped with a compressor. It includes a Klark Teknik internal multi-effects unit with 32 presets and a built-in USB sound card. The console also offers 4 stereo inputs, a 3-band EQ with parametric mids, and 3 auxiliary sends (Pre/Post). Each channel has an insert, peak LEDs, and mute functionality. It includes 2-track input/output and a main output via XLR, along with 2 sub-groups with separate outputs. The internal power supply ensures reliable performance. The dimensions are 430 x 370 x 90 mm, and it weighs 4.78 kg. A compatible dust cover (model 498246) is available separately.', , 199.00, 176, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(60, 'Focusrite Scarlett 2i2 4th Generation', '\r\nThe 2-channel USB 2.0 audio interface offers 24-bit/192 kHz resolution with Focusrite Rednet conversion (120 dB dynamic range) and 2 Scarlett mic preamps with 69 dB gain and +48V phantom power. It includes features like Auto Gain, Clip Safe, Loopback, dynamic gain halos, and a switchable Air function. The interface has 2 instrument/line inputs, 2 mic inputs, balanced line outputs, a stereo headphone output, and USB-C connectivity for PC/Mac. Powered via USB, it weighs 0.57 kg and measures 180 x 45 x 99 mm. The package includes a USB cable and the Hitmaker Expansion software bundle with various plugins.', , 185.00, 253, 4);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(61, 'Thomann TAS-180 Alto Sax', 'The alto saxophone features a brass body and mechanism with a high F# key and front F key. It has an adjustable plastic thumb rest and a comfortable mechanism for both the left and right pinky fingers. The removable bell adds flexibility, and the saxophone weighs 2.4 kg. It has a clear lacquer finish and comes with a standard mouthpiece, soft case with backpack straps for easy transport.', , 329.00, 0, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(62, 'Thomann TR-600 S C Trumpet', 'The B-flat trumpet features Monel pistons and a bore size of 11.73 mm. It has a gold brass bell with a diameter of 122 mm and a gold brass leadpipe. The trumpet includes a thumb hook on the first slide, a ring on the third valve slide, and outer slides made of maillechort. It has a silver-plated finish and comes with a 7C mouthpiece and a soft case with backpack straps for easy transport.', , 298.00, 127, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(63, 'Thomann GCL-420 MKII Bb-Clarinet', 'The Bb clarinet is an enhanced version with a German system, made from grenadilla wood. It features 20 keys, 6 rings, and silver-plated keywork. The adjustable thumb rest includes a ring for a strap, and it comes with two barrels (58 mm and 60 mm). Included accessories are an ESM mouthpiece, Rovner ligature, BG thumb rest protector, Thomann Deluxe swab, microfiber cloth, mouthpiece cap, grease, and a soft case with backpack straps for easy transport.', , 849.00, 2, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(64, 'Thomann Student Violinset 4/4', 'The 4/4 violin set features a solid spruce top, maple back and sides, and a maple neck. It has an ebony fingerboard and jujube pegs. The tailpiece is equipped with 4 fine tuners for precise tuning. The set includes a case, fiberglass bow, and rosin.', , 139.00, 63, 6);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(65, 'Stentor SR1505 Viola Student II 16\"', '\r\nThe 16\" viola, Student Model II, features a solid spruce top and solid maple body. It has an ebony fingerboard and pegs, along with a hardwood chin rest. The set includes a case and bow.', , 258.00, 52, 6);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(66, 'Stentor SR1102 Cello Student I 4/4', 'The beginner cello set, Student Model, is a 4/4 size instrument featuring a solid spruce top and solid maple body. It has dark hardwood pegs and a malacca fingerboard. The set includes a gig bag and bow.', , 753.00, 566, 6);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(67, 'Thomann 111SN 3/4 Double Bass', 'The 3/4 double bass features a laminated limewood top, back, and sides, with a maple neck and ebony fingerboard. It comes equipped with Artino strings and is finished in a matte light brown color. The set includes a cover, composite bow, and rosin.', , 849.00, 0, 6);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(68, 'Thomann HR-101 F-French Horn', '\r\nThe French horn in F for children features a smaller diameter brass bell, three rotary valves, and a main branch and valve group made of maillechort. It includes an adjustable hand rest for comfort. The set comes with a mouthpiece and case, making it suitable for children.', , 398.00, 6, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(69, 'Yamaha YSL-445 GE II Trombone', 'The tenor trombone features a 13.34 mm bore and a 241.4 mm gold brass bell. It has a lacquered finish and a nickel-silver slide. The set includes a hard case and a 48 mouthpiece.', , 1369.00, 7, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(70, 'Melton 2011RA-L Bb-Tuba', 'The Bb tuba is a 3/4 size instrument with a brass body and bell. It features 4 rotary valves, with a bore size of 18.50 mm and a 19.50 mm bore for the 4th valve. The bell has a diameter of 440 mm, and the tuba stands 910 mm tall, weighing 8.90 kg. It has a clear lacquer finish and includes a mouthpiece and a gig bag.', , 8390.00, 42, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(71, 'LaLique Oboe HF30', 'The semi-automatic oboe, Conservatory Model, is designed for beginners due to its lighter weight compared to wooden oboes. It features French fingering and is made from durable ABS plastic. The oboe is tuned to A = 442 Hz and includes a 3rd octave key, a left-hand F lever, a C# trill key, a left-hand Eb key, a right-hand Ab key, and a double C#/D trill key. It weighs 620 g and comes with a case and accessories.', , 1155.00, 567, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(72, 'Oscar Adler & Co. 1361 Bassoon Orchestra Model', 'The bassoon, \"Orchester\" model, features 27 keys and 11 rollers. It includes a high D key, a trill key for E/F#, a high E key, a double Eb key, a left-hand Ab key, a second Bb handle, and a trill key for Ab/Bb. All finger pads and tone holes are recessed inside the instrument. The bassoon has a high-gloss silver-plated mechanism and a body made from flamed Bosnian maple that has been stored for many years. The finish is a high-gloss varnish, and it includes a balancing bar. The set comes with two \"Oscar Adler & Co.\" bocals (numbers 1 and 2), a Tutti case, and accessories.', , 11555.00, 754, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(73, 'Muramatsu EX-III-RBE Flute', 'The transverse flute features a solid silver headjoint, hollowed-out key cups, and a G sharp mechanism. It includes an offset G and a B footjoint. The body and mechanism are made of silver, and the set comes with a case and cleaning swab.', , 3999.00, 432, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(74, 'Moeck 1020 Flauto 1 Plus Soprano', 'The soprano recorder features German fingering, with the upper part made of burgundy plastic and the lower part made of maple. It comes with a linen case for storage.', , 44.00, 45, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(75, 'Thomann Chromatic 40 Harp', 'The chromatic harmonica is in the key of C major, with 40 reeds. It features a black plastic comb and chrome covers, and is non-ventilated. The harmonica comes with a case for storage.', , 35.00, 1098, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(76, 'Thomann Kazoo (Metal)', 'The metal kazoo is approximately 120 mm in length. A replacement membrane is optional and not included.', , 4.55, 6289, 5);
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `fotos`, `precio`, `cantidad`, `categoria`) VALUES
(77, 'Thomann Mc Mini Bagpipe Set', 'The Thomann Mc Mini Dudelsack is a miniature bagpipe, featuring a playable chanter and decorative drones that are non-playable. It does not include a reed, but comes with a Thomann Plastic Chanter Reed and a drone reed. The bagpipe is made of plastic.', , 30.00, 672, 5);

